	public static void insertionssort(int[] a) {
		for (int i = 1; i < a.length; i++)
			if (a[i] < a[i - 1]) {
				int t = a[i];
				int j;
				for (j = i; j > 0 && a[j - 1] > t; j--)
					a[j] = a[j - 1];
				a[j] = t;
			}
	}
	
	public static void selectionsort(int[] a) {
		for (int i = a.length - 1; i > 0; i--) {
			int x = 0;
			for (int j = 1; j <= i; j++)
				if (a[j] > a[x])
					x = j;
			swap(i, x, a);
		}
	}
	
	public static void bubblesort(int[] a) {
		for (int n = 0; n < a.length; n++)
			for (int i = 1; i < a.length; i++)
				if (a[i] < a[i - 1])
					swap(i - 1, i, a);
	}
	
	public static void mergesort(int[] a) {
		int[] tmp = new int[a.length];
		mergesort(a, tmp, 0, a.length - 1);
	}
	
	public static void mergesort(int[] a, int[] tmp, int left, int right) {
		if (left < right) {
			int mid = (left + right) / 2;
			mergesort(a, tmp, left, mid);
			mergesort(a, tmp, mid + 1, right);
			merge(a, tmp, left, mid + 1, right);
		}
	}
	
	// code stolen from cs.nyu.edu
	public static void merge(int[] a, int[] tmp, 
			int leftPos, int rightPos, int rightEnd) {
		int leftEnd = rightPos - 1;
		int tmpPos = leftPos;
		int noElem = rightEnd - leftPos + 1;
		
		while (leftPos <= leftEnd && rightPos <= rightEnd)
			if (a[leftPos] <= a[rightPos])
				tmp[tmpPos++] = a[leftPos++];
			else
				tmp[tmpPos++] = a[rightPos++];
		
		while (leftPos <= leftEnd)
			tmp[tmpPos++] = a[leftPos++];
		
		while (rightPos <= rightEnd)
			tmp[tmpPos++] = a[rightPos++];
		
		for (int i = 0; i < noElem; i++, rightEnd--)
			a[rightEnd] = tmp[rightEnd];
	}
	
	public static void quicksort(int[] a) {
		quicksort(a, 0, a.length);
	}
	
	public static void quicksort(int[] a, int left, int right) {
		if (left < right) {
			int pivot = (left + right) / 2;
			swap(left, pivot, a);
			int i = left + 1;
			int j = right;
			while (i < j) {
				while (i < right && a[i] < a[left])
					i++;
				while (j > left && a[j - 1] > a[left])
					j--;
				if (i < j)
					swap(i, j - 1, a);
			}
			swap(left, j - 1, a);
			quicksort(a, left, i - 1);
			quicksort(a, i, right);
		}
	}
	
	private static void swap(int i, int j, int[] a) {
		int tmp = a[i];
		a[i] = a[j];
		a[j] = tmp;
	}
